import React from "react"

const Form = props => (
    <form className="form-container" onSubmit={props.getWeather}>
<label class="control-label city-container" for="email">Email:</label>
        <input className="" type="text" name="city" defaultValue="PALA" placeholder="Enter city" />

        <input className="country-container" type="text" name="country" defaultValue="IN" placeholder="Enter country" />

        <button>Get Weather</button>

    </form>

);

export default Form;
